const obj = JSON.parse(json);

function query(name) {
    result = []
    for (o in obj["data"]) {
        if (obj["data"][o]["Short Name"] == name.toUpperCase() || obj["data"][o]["Full Name"].toUpperCase().includes(name.toUpperCase())) {
            result.push(obj["data"][o]);
        }
    }
    return result;
}

function buildResultBlock(confInfo) {
    var card = document.createElement("div");
    card.className = "ui card";
    var content = document.createElement("div");
    content.className = "content";
    var header = document.createElement("a");
    header.className = "header";
    header.innerHTML = confInfo["Short Name"];
    var meta = document.createElement("div");
    meta.className = "meta";
    var info = document.createElement("span");
    info.className = "info";
    info.innerHTML = '<div class="ui breadcrumb"><div class="section"> Rank ' + confInfo["Rank"] + ' </div><div class="divider"> / </div><div class="section">' + confInfo["Type"] + ' </div><div class="divider"> / </div><div class="section">' + confInfo["Field"] + ' </div><div class="divider"> / </div><div class="section">' + confInfo["Publisher"] + '</div></div>';
    var description = document.createElement("div");
    description.className = "description";
    description.innerHTML = confInfo["Full Name"];
    var extra = document.createElement("div");
    extra.className = "extra content";
    var link = document.createElement("a");
    var linkattr = document.createAttribute("href");
    linkattr.value = confInfo["URL"];
    var linktarget = document.createAttribute("target");
    linktarget.value = "_blank"
    link.setAttributeNode(linkattr);
    link.setAttributeNode(linktarget);
    meta.appendChild(info);
    content.appendChild(header);
    content.appendChild(meta);
    content.appendChild(description);
    card.appendChild(content);
    link.innerHTML = '<i class="linkify icon"></i>' + confInfo["URL"];
    extra.appendChild(link);
    card.appendChild(extra);
    return card;
}

result = query(confName);
if (result.length != 0)
    result.forEach(element => {
        document.getElementById("cards").appendChild(buildResultBlock(element));
    });